/*Data for the table `sys_content` */

insert  into `sys_content`(`id`,`title`,`content`,`create_time`) values ('1265451035091066882','java开源后台管理项目','<p><b>java开源后台管理项目</b></p><p><b>介绍</b></p><article class=\"markdown-body mt-4\"><p>基于SpringBoot + Thymeleaf + Layui + Apache Shiro + Redis + Mybatis Plus 的后台管理系统<br>提供代码生成器，基本增删改查无需编写，可快速完成开发任务。<br>后台接口RESTful 风格，支持前后端分离，可与app公用一套接口。<br></p><p>开发最精简，可当脚手架，适合你来diy</p><p><b>特征</b></p><p></p><ul><li>后台接口RESTful 风格，支持前后端分离，可与app公用一套接口</li><li>采用RBAC的权限控制</li><li>统一响应结果封装及生成工具</li><li>统一异常处理</li><li>Shiro + Redis 实现 Token 角色权限认证</li><li>使用Druid Spring Boot Starter 集成Druid数据库连接池与监控</li><li>集成MyBatis-Plus，实现单表业务零SQL</li><li>支持多数据源，自由切换，只需方法或类上用 @DS 切换数据源</li><li>集成国人风格的knife4j，自动生成接口文档</li></ul><p></p><p></p><p><ul><li>提供代码生成器，生成从Html到Mapper，爽歪歪</li></ul></p><ul><li><b>代码仓库</b></li></ul><p></p><p></p><p>Gitee地址：<a href=\"https://gitee.com/zwens/springboot-manager\" target=\"_blank\">https://gitee.com/zwens/springboot-manager</a><br></p><p>GitHub地址：<a href=\"https://github.com/aitangbao/springboot-manager\" target=\"_blank\">https://github.com/aitangbao/springboot-manager</a></p><p><b>项目演示</b></p><p></p><ul><li>演示地址：<a href=\"http://manager.aitangbao.com.cn/login\" target=\"_blank\">http://manager.aitangbao.com.cn</a></li><li>账号密码：guest/123456</li></ul><p></p><p><ul><li>带宽1m 不太给力 请见谅&nbsp;</li></ul></p><ul><li><b>技术</b></li></ul><p></p><ul><li>核心框架：spring boot 2.1.6</li><li>持久层框架：mybatis plus</li><li>数据库连接池：alibaba druid</li><li>安全框架：apache shiro</li><li>缓存框架：redis</li><li>日志框架：logback</li><li>接口文档：Knife4j</li></ul><p></p><p><ul><li>前端模板：thymeleaf+layui2x</li></ul></p><ul><li><b>开发建议</b></li></ul><p></p><ul><li>Model内成员变量建议与表字段数量对应，如需扩展成员变量（比如连表查询）建议创建VO，否则需在扩展的成员变量上加@TableField(exist = false)</li><li>如果表有是否删除字段，需要在Model注解@TableLogic 默认1未删 0删除， 或@TableLogic(value=\"逻辑未删除值\",delval=\"逻辑删除值\")</li></ul><p></p><p><ul><li>建议业务失败直接使用throw new BusinessException(\"ErrorMessage\")抛出，由统一异常处理器来封装业务失败的响应结果，会直接被封装为{\"code\":500002,\"message\":\"ErrorMessage\"}返回，尽情抛出；</li></ul></p><ul><li><b>使用说明</b></li></ul><p></p><ul><li>使用IDE导入本项目，IDE需要安装lombok插件</li><li>下载redis 启动redis</li><li>创建company_project数据库，导入doc下的company_project.sql</li><li>运行项目<ol><li>直接运行CompanyProjectApplication.java</li><li>项目根目录下执行mvn -X clean package -Dmaven.test.skip=true编译打包，然后执行java -jar manager.jar</li></ol></li><li>接口文档访问&nbsp;<a href=\"http://localhost:8080/doc.html\" target=\"_blank\">http://localhost:8080/doc.html</a></li><li>登录地址&nbsp;<a href=\"http://localhost:8080/index/login\" target=\"_blank\">http://localhost:8080/index/login</a>&nbsp;用户名密码:admin/123456</li><li>代码生成使用：<ol><li>点击[代码生成]菜单，生成一个或多个表的代码，下载到本地</li><li>解压下载的代码，直接复制main文件夹到本地项目的src目录下</li><li>数据库执行sql，生成菜单</li></ol><p></p><p><ol><li>点击[角色管理]菜单，修改角色所绑定的菜单的权限，刷新页面查看</li></ol></p><ol><li><b>参与贡献</b></li></ol><p></p></li></ul><ol><li>Fork 本项目</li><li>新建 feature_xxx 分支</li><li>提交代码</li></ol><p></p><p><ol><li>提交 Pull Request</li></ol></p><ol><li><b>效果图</b></li></ol><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200507134721.png\" data-fancybox=\"images\" data-caption=\"image-20200507134713461\"><img src=\"http://tuchuang.aitangbao.com.cn/20200507134721.png\" alt=\"image-20200507134713461\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200507134721.png\" data-fancybox=\"images\" data-caption=\"image-20200507134713461\">image-20200507134713461</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161348.png\" data-fancybox=\"images\" data-caption=\"2\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161348.png\" alt=\"2\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161348.png\" data-fancybox=\"images\" data-caption=\"2\">2</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161353.png\" data-fancybox=\"images\" data-caption=\"3\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161353.png\" alt=\"3\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161353.png\" data-fancybox=\"images\" data-caption=\"3\">3</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161355.png\" data-fancybox=\"images\" data-caption=\"4\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161355.png\" alt=\"4\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161355.png\" data-fancybox=\"images\" data-caption=\"4\">4</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161404.png\" data-fancybox=\"images\" data-caption=\"5\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161404.png\" alt=\"5\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161404.png\" data-fancybox=\"images\" data-caption=\"5\">5</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161359.png\" data-fancybox=\"images\" data-caption=\"7\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161359.png\" alt=\"7\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161359.png\" data-fancybox=\"images\" data-caption=\"7\">7</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200430172453.png\" data-fancybox=\"images\" data-caption=\"image-20200430172452726\"><img src=\"http://tuchuang.aitangbao.com.cn/20200430172453.png\" alt=\"image-20200430172452726\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200430172453.png\" data-fancybox=\"images\" data-caption=\"image-20200430172452726\">image-20200430172452726</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161414.png\" data-fancybox=\"images\" data-caption=\"9\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161414.png\" alt=\"9\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161414.png\" data-fancybox=\"images\" data-caption=\"9\">9</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161423.png\" data-fancybox=\"images\" data-caption=\"12\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161423.png\" alt=\"12\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161423.png\" data-fancybox=\"images\" data-caption=\"12\">12</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161425.png\" data-fancybox=\"images\" data-caption=\"13\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161425.png\" alt=\"13\"></a></p><p class=\"text-center text-muted pt-3\" style=\"text-align: center;\"><a href=\"http://tuchuang.aitangbao.com.cn/20200429161425.png\" data-fancybox=\"images\" data-caption=\"13\">13</a></p><p></p><p><a href=\"http://tuchuang.aitangbao.com.cn/20200429161428.png\" data-fancybox=\"images\" data-caption=\"16\"><img src=\"http://tuchuang.aitangbao.com.cn/20200429161428.png\" alt=\"16\"></a></p></article>','2020-04-22 16:58:35');

/*Table structure for table `sys_dept` */

DROP TABLE IF EXISTS `sys_dept`;

CREATE TABLE `sys_dept` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `dept_no` varchar(18) DEFAULT NULL COMMENT '部门编号(规则：父级关系编码+自己的编码)',
  `name` varchar(300) DEFAULT NULL COMMENT '部门名称',
  `pid` varchar(64) NOT NULL COMMENT '父级id',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态(1:正常；0:弃用)',
  `relation_code` varchar(3000) DEFAULT NULL COMMENT '为了维护更深层级关系',
  `dept_manager_id` varchar(64) DEFAULT NULL COMMENT '部门经理user_id',
  `manager_name` varchar(255) DEFAULT NULL COMMENT '部门经理名称',
  `phone` varchar(20) DEFAULT NULL COMMENT '部门经理联系电话',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `deleted` tinyint(4) DEFAULT '1' COMMENT '是否删除(1未删除；0已删除)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统部门';

